import React from 'react';
import { ThemeContext } from '../contexts/ThemeContext';

class NavBar extends React.Component {
    static contextType = ThemeContext;
    
    render() { 
        return (
            
            <nav>
                <h2>Context App</h2>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
                {console.log(this.context)}
            </nav>
        );
    }
}
 
export default NavBar;
